import './App.css';
import SignInView from './components/SignInView/SignInView';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter , Routes, Route} from 'react-router-dom'
import SignUpView from './components/Screens/SignUpView/SignUpView';
import HomeView from './components/Screens/HomeView/HomeView';
import NavbarView from './components/navBar/Navbar';
import AboutUs from './components/Screens/About Us/AboutUs';
function App() {
  const loggedIn = true;
  return (
    <BrowserRouter>
    <div className="App">
    <NavbarView loggedIn={loggedIn}>
      <SignInView/>
      </NavbarView>
      <Routes>
        <Route path="/Home" exact element={<HomeView/>}/>
        <Route path="/SignUp" exact element={<SignUpView/>}/>
        <Route path="/AboutUs" exact element={<AboutUs/>}/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
